import React from 'react';
import { useParams } from 'react-router-dom';

const ProfilePage: React.FC = () => {
    const { id } = useParams<{ id: string }>();

    return (
        <div>
            <h1>Profile Page</h1>
            <p>This is the profile page for user with ID: {id}</p>
        </div>
    );
};

export default ProfilePage;
